import React, { useState, useEffect } from "react";
import './Test.css'
import { Questions } from "./Questions";

function Test() {
  const [responses, setResponses] = useState([]);
  const [index, setIndex] = useState(0);
  const [question, setQuestion] = useState(Questions[index]);
  const [selectedAnswer, setSelectedAnswer] = useState(null);
  const [floatInput, setFloatInput] = useState(0);
  const [result, setResult] = useState(false);
  const [isAnswered, setIsAnswered] = useState(false);

  useEffect(() => {
    setQuestion(Questions[index]);
    setIsAnswered(false);
    setSelectedAnswer(null);
  }, [index]);

  useEffect(() => {
    setIndex(0);
  }, []);

  const predictWithMLModel = (inputData) => {
    fetch('http://127.0.0.1:5000/predict', {
      method: 'POST',
      headers: {
        'Content-Type': 'application/json'
      },
      body: JSON.stringify(inputData)
    })
    .then(response => response.json())
    .then(predictions => {
      // Handle the predictions received from the Flask backend
      console.log('Predictions:', predictions);
    })
    .catch(error => {
      console.error('Error:', error);
    });
  };

  const handleNext = () => {
    const response = selectedAnswer !== null ? selectedAnswer : floatInput;
    setResponses(prevResponses => [...prevResponses, response]);
    console.log(responses);

    if (index === Questions.length - 1) {
      setResult(true);
      // For demonstration purposes, send only the response to the first question
      const responseForFirstQuestion = responses.length > 0 ? responses[0] : null;
      console.log('Response for the first question:', responseForFirstQuestion);

      // Send all responses to the Flask backend for prediction
      predictWithMLModel(responses);
    } else {
      setIndex(prevIndex => prevIndex + 1);
    }
  };

  const handlePrev = () => {
    if (index > 0) {
      setIndex(prevIndex => prevIndex - 1);
    }
  };

  const reset = () => {
    setResponses([]);
    setIndex(0);
    setSelectedAnswer(null);
    setFloatInput(0);
    setResult(false);
  };

  return (
    <div className="container">
      <h1>Diabetes Prediction Test</h1>
      <hr />
      {result ? (
        <>
          <h2>Test is submitted successfully</h2>
          <button className="reset" onClick={reset}>Reset</button>
        </>
      ) : (
        <>
          <h2>{index+1}. {question.question}</h2>
          {index === 0 ? (
            <>
              <input
                type="range"
                min={0}
                max={200}
                step={0.1}
                value={floatInput}
                onChange={e => setFloatInput(parseFloat(e.target.value))}
              />
              <p>Value: {floatInput.toFixed(1)} kg</p>
            </>
          ) : (
            <ul>
              {Object.keys(question).filter(key => key.startsWith("option")).map((option, i) => (
                <li
                  key={option}
                  className={selectedAnswer === i + 1 ? "selected" : ""}
                  onClick={() => setSelectedAnswer(i + 1)}
                >
                  {question[option]}
                </li>
              ))}
            </ul>
          )}
          <button onClick={handlePrev} disabled={index === 0}>Previous</button>
          <button onClick={handleNext} disabled={!isAnswered}>Next</button>
          <div className="index">{index+1} of {Questions.length} questions</div>
        </>
      )}
    </div>
  );
}

export default Test;
